    false,nt"url": null,nt"notes": "These data are detections of reptiles in
    2006 under 2 ft x 2 ft dimension plywood coverboards at four of the 15 sample points
    at Spears and Didion Ranches, Placer County, California. There are 81 coverboards
    in a 9 board by 9 board array (on 15 m spacing) centered on the sample points. Coverboards
    were placed in oak woodland and annual grassland habitat in November-December 2006
    and checked on a bi-weekly basis between March-July 2006. All 204 animals found
    under the coverboards were counted, identified to species, and aged and sexed.",nt"owner_org":
